import React from "react";
import { Link } from "react-router-dom";
import "./Login.css";

function Login() {
  return (
    <div className="login">
      <Link to="/">
        <img
          src="http://pngimg.com/uploads/amazon/amazon_PNG13.png"
          alt=""
          className="login__image"
        />
      </Link>
    </div>
  );
}

export default Login;
